import React, { Component } from "react"
import "./About.css"

export default class About extends Component {
  constructor(props) {
    super(props)
    this.state = {}
    this.chooseAbout = this.chooseAbout.bind(this)
  }

  chooseAbout(alg) {
    switch (alg) {
      case 1:
        return (
          <div>
            The full steps and explanation of this algorithm are in my github.
            <br></br>
            <br></br>
            <div>Step 1: Initialize Water Level, Total Water, and Border</div>
            <div>Step 2:</div>
          </div>
        )

      default:
        return "Choose an algorithm!"
    }
  }

  render() {
    return (
      <span className="About">{this.chooseAbout(this.props.selectedAlg)}</span>
    )
  }
}
